import { initializeApp } from "firebase/app";
import { getAuth, GoogleAuthProvider, signInWithPopup } from "firebase/auth";
import { getStorage } from 'firebase/storage';
import { getFirestore } from 'firebase/firestore/lite';

const firebaseConfig = {
  apiKey: "AIzaSyDpDemK3wa5ZRXMXsK1D7sERabctOJQsCE",
  authDomain: "react-portfolio-dashboar-a6a93.firebaseapp.com",
  projectId: "react-portfolio-dashboar-a6a93",
  storageBucket: "react-portfolio-dashboar-a6a93.appspot.com",
  messagingSenderId: "586190139166",
  appId: "1:586190139166:web:23549198fbba9961d7630f"
};

const app = initializeApp(firebaseConfig);
export const auth = getAuth();
const provider = new GoogleAuthProvider();
export const db = getFirestore(app);
export const storage = getStorage(app);


export const signInWithGoogle = () => signInWithPopup(auth, provider);
